import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './Login';
import Signup from './Signup';
import Dashboard from './Dashboard';
import HealthCheck from './HealthCheck';
import GetAllDevices from './GetAllDevices';
import GetDevicesCount from './GetDevicesCount';
import GetNotificationCount from './GetNotificationCount';
import AddDevice from './AddDevice';
import DeleteDevice from './DeleteDevice';
import './styles.css';
const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/login" element={<Login />} />
        <Route path="/signup" element={<Signup />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/healthcheck" element={<HealthCheck />} />
        <Route path="/getalldevices" element={<GetAllDevices />} />
        <Route path="/getdevicescount" element={<GetDevicesCount />} />
        <Route path="/getnotificationcount" element={<GetNotificationCount />} />
        <Route path="/adddevice" element={<AddDevice />} />
        <Route path="/deletedevice" element={<DeleteDevice />} />
      </Routes>
    </Router>
  );
};

export default App;
